import TitleBar from "./titlebar/TitleBar";
import SlidingImages from "./mainbody/SlidingImages";
import './App.css';
import ImageCard from "./mainbody/ImageCard";
function App() {
  return (
    <div className="app">
      <TitleBar/>
      <div className="slide">
        <SlidingImages/>
      </div>
      <h2>Let's get started!</h2>

    <ImageCard/>
    </div>
  );
}

export default App;
